import React, { Component } from "react";

class UserGreeting extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedin: false,
    };
  }

  render() {
    if (this.state.isLoggedin) {
      return <div>Welcome Ravina</div>;
    } else {
        return <div></div>
    }
    return (
      <div>
        <div>Welcome Ravina</div>
        <div>Welcome Guest</div>
      </div>
    );
  }
}

export default UserGreeting;
